import * as types from './../constants/ActionTypes';

// khoi tao ko tham so
let initialState = [];

//truyen ko tham so
let myReducer = (state = initialState, action) => {
    switch(action.type){
        case types.KOTHAMSO:{
            console.log("vao KOTHAMSO");
            return state;
        }
        default: return state; //state cua store
    }
}

export default myReducer;
